import React from "react";
import { Wrap, FlexItem, FlexItems, CountText } from "../styles/Partners";
import CountUp from "react-countup";
import Fade from "react-reveal/Fade";

function Partners() {
  return (
    <Wrap>
      <div className="container">
        <FlexItems>
          <FlexItem>
            <Fade top delay={300}>
              <div>
                <CountUp end={100} redraw={true}>
                  {({ countUpRef, start }) => (
                    <VisibilitySensor onChange={start} delayedCall>
                      <span ref={countUpRef} />
                    </VisibilitySensor>
                  )}
                </CountUp>
                +
              </div>
            </Fade>
            <CountText>Senior and leadership hires</CountText>
          </FlexItem>

          <FlexItem>
            <Fade top delay={800}>
              <div>
                <CountUp end={17} redraw={true}>
                  {({ countUpRef, start }) => (
                    <VisibilitySensor onChange={start} delayedCall>
                      <span ref={countUpRef} />
                    </VisibilitySensor>
                  )}
                </CountUp>{" "}
                +
              </div>
            </Fade>
            <CountText>Countries we have placed individuals</CountText>
          </FlexItem>
        </FlexItems>
      </div>
    </Wrap>
  );
}

export default Partners;
